<node CREATED="1687095496822" FOLDED="true" ID="ID_1557604157" MODIFIED="1687868376552" TEXT="Deixar o conteudo:">
<icon BUILTIN="Descriptor.grouping"/>
<node CREATED="1690209869222" ID="ID_1710162797" MODIFIED="1690209873762" TEXT="import { Produto } from &apos;./produto.model&apos;;&#xa;&#xa;export interface IItemPedido {&#xa;    id?: number;&#xa;    produto: Produto;&#xa;    quantidade: number;&#xa;    precoUnitario: number;&#xa;    desconto: number;&#xa;    precoTotal: number;&#xa;}&#xa;&#xa;export class ItemPedido {&#xa;    id?: number;&#xa;    produto: Produto;&#xa;    quantidade: number;&#xa;    precoUnitario: number;&#xa;    desconto: number;&#xa;    precoTotal: number;&#xa;&#xa;    constructor(private iItemPedido?: IItemPedido) {&#xa;        if (iItemPedido == null) {&#xa;            this.produto = null;&#xa;            this.quantidade = null;&#xa;            this.precoUnitario = null;&#xa;            this.desconto = null;&#xa;            this.precoTotal = null;&#xa;        } else {&#xa;            this.id = iItemPedido.id;&#xa;            this.produto = iItemPedido.produto;&#xa;            this.quantidade = iItemPedido.quantidade;&#xa;            this.precoUnitario = iItemPedido.precoUnitario;&#xa;            this.desconto = iItemPedido.desconto;&#xa;            this.precoTotal = iItemPedido.precoTotal;&#xa;        }&#xa;    }&#xa;&#xa;    calculaTotal(): void {&#xa;        this.precoTotal = (this.precoUnitario * this.quantidade) - this.desconto;&#xa;    }&#xa;&#xa;    carregaPrecoProduto(): void {&#xa;        this.precoUnitario = this.produto.preco;&#xa;    }&#xa;&#xa;}&#xa;">
<icon BUILTIN="tag_green"/>
</node>
</node>
</node>
<node CREATED="1687098119343" ID="ID_899211766" MODIFIED="1690209913686" TEXT="frontend/src/app/models/pedido.model.ts">
<icon BUILTIN="list"/>
<node CREATED="1687095496822" FOLDED="true" ID="ID_1655757347" MODIFIED="1687868378063" TEXT="Deixar o conteudo:">
<icon BUILTIN="Descriptor.grouping"/>
<node CREATED="1690209968878" ID="ID_1099179944" MODIFIED="1690209982239" TEXT="import { ItemPedido } from &apos;./itemPedido.model&apos;;&#xa;import { SituacaoPedido } from &apos;./situacaoPedido.model&apos;;&#xa;import { Pessoa } from &apos;./pessoa.model&apos;;&#xa;&#xa;export interface IPedido {&#xa;    id?: number;&#xa;    cliente: Pessoa;&#xa;    situacao: SituacaoPedido;&#xa;    dataPedido: Date;&#xa;    itens: ItemPedido[];&#xa;    desconto: number;&#xa;    precoTotal: number;&#xa;}&#xa;&#xa;export class Pedido {&#xa;    id?: number;&#xa;    cliente: Pessoa;&#xa;    situacao: SituacaoPedido;&#xa;    dataPedido: Date;&#xa;    itens: ItemPedido[];&#xa;    desconto: number;&#xa;    precoTotal: number;&#xa;&#xa;    constructor(private iPedido?: IPedido) {&#xa;        if (iPedido == null) {&#xa;            this.cliente = null;&#xa;            this.situacao = null;&#xa;            this.dataPedido = null;&#xa;            this.itens = [];&#xa;            this.desconto = null;&#xa;            this.precoTotal = null;&#xa;        } else {&#xa;            this.id = iPedido.id;&#xa;            this.cliente = iPedido.cliente;&#xa;            this.situacao = iPedido.situacao;&#xa;            this.dataPedido = iPedido.dataPedido;&#xa;            this.itens = [];&#xa;            for (let iItem_itens of iPedido.itens) {&#xa;                this.itens.push(new ItemPedido(iItem_itens));&#xa;            }&#xa;            this.desconto = iPedido.desconto;&#xa;            this.precoTotal = iPedido.precoTotal;&#xa;        }&#xa;    }&#xa;&#xa;    calculaTotal(): void {&#xa;        var somaTotalItens = 0;&#xa;        for (var item_itens of this.itens) {&#xa;            somaTotalItens += item_itens.precoTotal;&#xa;        }&#xa;        this.precoTotal = somaTotalItens - this.desconto;&#xa;    }&#xa;&#xa;}&#xa;">
<icon BUILTIN="tag_green"/>
</node>
</node>
</node>
